import React from "react";
import { Element, Li } from "react-scroll";

const Main = ({ children }) => {
  return (
    <main>
      {React.Children.map(children, (child, index) => (
        <Element key={index} name={`section${index}`} className="element">
          <div
            style={{
              flex: "1",
              minHeight: "100vh",
              display: "flex",
              flexDirection: "column",
            }}
          >
            <Link
        activeClass="active"
        to="section0"
        spy={true}
        smooth={true}
        offset={-50}
        duration={500}
      >
            {child}
            </Link>
          </div>
        </Element>
      ))}
    </main>
  );
};

export default Main;
